import * as urljoin from 'url-join';

var ipdata = function ipdata(ip, apiKey) {
  var url = urljoin('https://api.ipdata.co/', '?api-key=' + apiKey);

  return fetch(url, { method: 'GET' }); // eslint-disable-line
};

export default ipdata;
